import React from 'react';
import ItemCard from '../../components/ui/ItemCard';
import { ThemeContext } from "../../context/Theme";
import { useContext, useState } from 'react';

export const AdminAddItem = ({setSelected}) => {
    const [theme] = useContext(ThemeContext);

    return (
        <>
        <div className="col-span-8 overflow-hidden rounded-lg text-xs md:text-md w-64 px-8 sm:w-full h-full">
    <div className="flex justify-between items-center py-4">
        <h1 className="text-3xl font-bold">Items</h1>
        <button onClick={ () => {setSelected("Items")}} className="px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600">
            Back Button
        </button>
    </div>
</div>

<div className="flex items-center justify-center min-h-screen">
  <div className="flex w-full max-w-4xl">
    <div className="w-1/2 pr-8">
      <img src="https://source.unsplash.com/random" alt="Upload Image" className="w-full h-auto rounded-lg" />
    </div>
    <div className="w-1/2">
      <input type="text" placeholder="Name" className="w-full border border-gray-300 p-2 mb-4 rounded-lg" />
      <input type="text" placeholder="Email" className="w-full border border-gray-300 p-2 mb-4 rounded-lg" />
      <input type="text" placeholder="Phone" className="w-full border border-gray-300 p-2 mb-4 rounded-lg" />
      <input type="text" placeholder="Address" className="w-full border border-gray-300 p-2 mb-4 rounded-lg" />
      <div className="flex justify-end">
        <button className="px-4 py-2 bg-blue-500 text-white rounded-lg mr-4">Submit</button>
        <button className="px-4 py-2 bg-gray-500 text-white rounded-lg">Reset</button>
      </div>
    </div>
  </div>
</div>

</>
);
};

export default AdminAddItem;
